    <h5>この回答はお役に立ちましたか？</h5>
    <div className = "form-select">
    <Link href="/feedback"><a  className="button button-black ico-back">フィードバックを送る<ArrowR/></a></Link>
     </div>
     </div>

     </div>
  );
}
